import React, { Fragment } from "react";
import { NavLink } from "react-router-dom";

const Register = () => {
  return (
    <Fragment>
      <div className="row w-100 p-0 m-0 justify-content-center user-login-container">
        <div className="col-md-6 user-login login" >
          <i></i>
         
          <h3>شماره موبایل خود را وارد نمایید.</h3>
          <form className="login-form">
            <label>شماره موبایل <span>*</span></label>
            <input
              className='login-number'
              type="text"
              placeholder="شماره موبایل"
            />
            
            <NavLink to="/" className="login-submit login-register-submit" type="button" href="#">ثبت نام </NavLink>
          </form>
        </div>
        
      </div>
    </Fragment>
  );
};

export default Register;
